Defendant Tiffany Marie Hughes in court with attorney Torrie R. Williams.  Daniel J. Gabler appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to GUILTY.  Defendant examined as to his plea, advised of his Constitutional rights and the maximum penalty.   Defendant advised that if not a United States Citizen, deportation is possible.  Court found that defendant knowingly, voluntarily and intelligently waived his rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 4 months in the House of Correction with credit for 1 day time served.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 12 months.
Conditions:  
*  No contact with Progressive Insurance Company;
*  Pay restitution in the amount of $5878.91 to Progressive Insurance Company or, if not paid, convert to a civil judgment;
*  Maintain full time employment/school;
*  Perform 40 hours of community service;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.

If restitution is paid in full, probation may be terminated early.  Notice of Right to Seek Postconviction Relief received and filed.
